d using datatable\n| FormData.xlsx |\nAnd user clicks on save button\nThen about section is updated\n\n@Project\nScenario: Validate Add projects field in Add profile section\nWhen user clicks on profile\nAnd user clicks on add profile section button\nAnd user clicks on recommended dropdown\nAnd user clicks on add projects button\nAnd user enters valid data in required fields using datatable\n| FormData.xlsx  |\nAnd user clicks on save button\nThen a new project is added in users profile\n\n@VolExp\nScenario: Validate Add volunteer experience in Add profile section\nWhen user clicks on profile\nAnd user clicks on add profile section button\nAnd user clicks on additional dropdown\nAnd user clicks on add volunteer experience button\nAnd user enters valid data in fields using datatable\n| FormData.xlsx  |\nAnd user clicks on save button\nThen a new volunteer experience is added in users profile\n\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Windows\/System32\/config\/systemprofile\/eclipse-workspace\/LinkedInProject\/LinkedIn_Profile\/src\/test\/resource\/Feature\/LinkedInProfile.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@linkedinProfile","id":"98c1ead8-a2d8-4e7b-ac9b-17a7f743d9a9"}],"language":"en","keyword":"Feature","name":"Validate LinkedIn Profile","description":"","children":[{"background":{"location":{"line":4,"column":1},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":12},"keyword":"Given ","keywordType":"Context","text":"user is logged in","id":"9329271d-4092-4811-9af7-988340978d6d"}],"id":"bdf41ead-b894-4f25-afae-fbf060b21ada"}},{"scenario":{"location":{"line":7,"column":1},"tags":[{"location":{"line":6,"column":1},"name":"@InvalidIntro","id":"05422dc4-25f0-4ba9-9a3b-b7ef225f202f"}],"keyword":"Scenario Outline","name":"Validate edit intro icon and its fields with invalid data","description":"","steps":[{"location
